import React from 'react';
import './Input.css';

const Input = () => {
    return (
        <div className='input'>
            <div className='title'>
                Title
                <input className='inputBox'/>
            </div>
            <div className='content'>
                Content
                <input />
            </div>
        </div>
    );
};


export default Input;
